int16_t CalculateAltitude(uint32_t qnh, uint16_t temperature, uint32_t pressure) {
    if (pressure < PRESSURE_OFFSET || pressure > PRESSURE_OFFSET + UINT16_MAX) {
        return INT16_MAX;
    }

    uint8_t qnhIndex = QNH_Index(qnh);
    uint8_t tempIndex = TEMP_Index(temperature);
    if (qnhIndex == LOOKUP_OUT_OF_RANGE || tempIndex == LOOKUP_OUT_OF_RANGE) {
        return INT16_MAX;
    }

    const uint16_t *lookupTable = ALT_Lookup[qnhIndex][tempIndex];
    uint16_t offsetPressure = pressure - PRESSURE_OFFSET;

    if (offsetPressure > lookupTable[0]) {
        return INT16_MAX;
    }

    for (uint8_t i = 1; i < ALTITUDE_LOOKUP_SIZE; i++) {
        if (offsetPressure > lookupTable[i]) {
            uint16_t deltaAlt = (offsetPressure - lookupTable[i]) * 100 / (lookupTable[i - 1] - lookupTable[i]);

            return Index_ToAlt(i) - deltaAlt;
        }
    }

    return INT16_MAX;
}
